import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import CreateTest from './components/CreateTest/CreateTest';
import RunTest from './components/RunTest/RunTest';
import TestResults from './components/TestResults/TestResults';
import TestResult from './components/TestResult/TestResult';
import './App.css';

const App: React.FC = () => {
  return (
    <Router>
      <div className="app">
        <header>
          <h1>
            <span>Win</span>
            <span>Ab</span>
          </h1>
          <p>Discover what your customers respond to and maximize your impact with WinAb</p>
        </header>

        <nav>
          <Link to="/create-test">Create AB Test</Link>
          <Link to="/run-test">Create Mock Clicks/Impressions</Link>
          <Link to="/tests">Tests</Link>
        </nav>

        <div className="tab-content">
          <Switch>
            <Route path="/create-test">
              <CreateTest />
            </Route>
            <Route path="/run-test">
              <RunTest />
            </Route>
            <Route exact path="/tests">
              <TestResults />
            </Route>
            <Route path="/tests/:testName">
              <TestResult test_name={test_name} />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
};

export default App;
